import React, { Component } from 'react';
import axios from 'axios'
// import {withRouter} from 'react-router-dom';
import { Grid } from 'antd-mobile';

import '../../../style/tacketList.scss'

class TacketList extends Component {
    constructor(){
        super();
        this.state = {
            //热门门票
            hotTicket:[],
        }
    }
    componentWillMount(){
		axios.get('/myapi/wapapi/hbztj.do',{
			params:{
                cityid:1,
				sign:'bb4284fa771000e8c0',
				time:1543729843
			}
		}).then(res=>{
            let data = res.data;
            console.log(data)
			this.setState({
				hotTicket:data,
			});
        });
    }
    handlerGotoDetails(tickets){
        //获取history
        let {history} = this.props;
        console.log(history);
        history.push({
            // pathname:'/goods/'+tickets.id,
            state:tickets
        });
    }
  render() {
    return (         
        <div className="tacketList">
                        <div className="listTitle">
                            <i></i>
                            <h3>热门</h3>
                        </div>
                    </div>
       
      

    );
  }
}

// TacketList = withRouter(TacketList);
export default TacketList;
